import React from 'react';



const Rank = ({ name, entries }) => {
    return (
        <div>   
            <div className='white f3'>
                {'${name} , your current rank is ${entries}'}
            </div>
            <div className='white f1'>
                {'#90000'}
            </div>
        </div>
    );
}

export default Rank;
